import React from 'react';

export default ({ title, children }) => {
  return (
    <div className='bg-red-500 border-b border-gray-300 pt-8 pb-14'>
      <div className='bg-blue-500'>
        <h3
          style={{ fontFamily: 'airbnb-medium' }}
          className='text-2xl my-4 text-gray-750'>
          {title}
        </h3>
        {children}
      </div>
    </div>
  );
};
